import React from 'react';

import { AvailableIcons } from '@/components/atoms/img/Icon';
import Button from '@/components/atoms/button/Button';

import {
  Container,
} from './styles';

const Hero: React.FC = () => (
  <Container>
    <div>
      <Button iconName={AvailableIcons.logo}>Estudar</Button>
      <Button iconName={AvailableIcons.logo}>Dar aulas</Button>
    </div>
  </Container>
);

export default Hero;
